import React from 'react';
import { Modal, Button, Form } from 'react-bootstrap';

const AgregarNodoModal = ({ show, handleClose }) => {
    return (
        <Modal show={show} onHide={handleClose}>
            <Modal.Header closeButton>
                <Modal.Title>Agregar Nodo</Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <Form>
                    <Form.Group controlId="formLatitud">
                        <Form.Label>Latitud:</Form.Label>
                        <Form.Control type="text" placeholder="Ingrese la latitud" />
                    </Form.Group>

                    <Form.Group controlId="formLongitud">
                        <Form.Label>Longitud:</Form.Label>
                        <Form.Control type="text" placeholder="Ingrese la longitud" />
                    </Form.Group>
                </Form>
            </Modal.Body>
            <Modal.Footer>
                <Button variant="secondary" onClick={handleClose}>
                    Cerrar
                </Button>

            </Modal.Footer>
        </Modal>
    );
};

export default AgregarNodoModal;
